create table calendar as

select date::date as calendar_at
       , extract('year' from date) as year
	   , extract('month' from date) as month
from generate_series(date '2021-01-01',
                       date '2050-12-31',
                       interval '1 month')
as t(date);

create table loans (
       id INT,
       loan_at DATE,
       installments INT,
       rate DECIMAL(2,1),
       value INT
);



create table payments (
       id INT,
       receiver VARCHAR(50),
       payment_type VARCHAR(6),
       payment_date DATE,
       amount DECIMAL(9,2)
);


update payments
set id = id + 1;

update payments
set amount = 4500
where lower(receiver) = 'landlord';

update payments
set amount = 12825
where id = 31;

update payments
set amount = 24300
where id = 44;

update payments
set amount = 1250
where receiver = 'Tracey Cauthra';

create table purchases (
       id INT,
       product_name VARCHAR(50),
       vendor_id INT,
       payment_method VARCHAR(11),
       is_account VARCHAR(50),
       purchase_at DATE,
       delivery_day INT,
       payment_day INT,
       delivery_at DATE,
       payment_at DATE,
       quantity INT,
       amount decimal(9,2)
);


ALTER TABLE purchases DROP COLUMN is_account;
ALTER TABLE purchases DROP COLUMN delivery_day;
ALTER TABLE purchases DROP COLUMN payment_day;

create table sales (
       id INT,
       product_name VARCHAR(50),
       vendor_id INT,
       payment_method VARCHAR(11),
       is_account VARCHAR(50),
       sale_at DATE,
       delivery_day INT,
       sale_day INT,
       payment_at DATE,
       delivery_at DATE,
       quantity INT,
       price decimal(9,2)
);

ALTER TABLE sales DROP COLUMN is_account;
ALTER TABLE sales DROP COLUMN delivery_day;
ALTER TABLE sales DROP COLUMN sale_day;
